import React, { useEffect, useState, useContext } from "react";
import { useParams, useNavigate } from "react-router-dom";
import api from "../api/api";
import { AuthContext } from "../context/AuthContext";

const StudentDetailsPage = () => {
  const { id } = useParams(); // ID do aluno vindo da URL
  const { token } = useContext(AuthContext);
  const navigate = useNavigate();

  const [student, setStudent] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  // Abas (Informa√ß√µes, Treinos, Feedbacks, Progresso)
  const [activeTab, setActiveTab] = useState("info");

  useEffect(() => {
    const fetchStudent = async () => {
      try {
        const res = await api.get(`/students/${id}`, {
          headers: { Authorization: `Bearer ${token}` },
        });
        setStudent(res.data);
      } catch (err) {
        console.error(err);
        setError("Erro ao carregar informa√ß√µes do aluno");
      } finally {
        setLoading(false);
      }
    };

    fetchStudent();
  }, [id, token]);

  if (loading)
    return <p className="text-center mt-5">Carregando informa√ß√µes...</p>;
  if (error)
    return <p className="text-center text-danger mt-5">{error}</p>;

  return (
    <div className="container mt-4">
      {/* Bot√£o de voltar */}
      <button
        className="btn btn-outline-secondary mb-3"
        onClick={() => navigate(-1)}
      >
        ‚¨Ö Voltar
      </button>

      {/* Card principal */}
      <div className="card p-4 shadow-sm">
        <h3 className="mb-3">{student.name}</h3>

        {/* Abas de navega√ß√£o */}
        <ul className="nav nav-tabs mb-3">
          <li className="nav-item">
            <button
              className={`nav-link ${activeTab === "info" ? "active" : ""}`}
              onClick={() => setActiveTab("info")}
            >
              üßæ Informa√ß√µes
            </button>
          </li>
          <li className="nav-item">
            <button
              className={`nav-link ${activeTab === "workouts" ? "active" : ""}`}
              onClick={() => setActiveTab("workouts")}
            >
              üèãÔ∏è Treinos
            </button>
          </li>
          <li className="nav-item">
            <button
              className={`nav-link ${activeTab === "feedbacks" ? "active" : ""}`}
              onClick={() => setActiveTab("feedbacks")}
            >
              üí¨ Feedbacks
            </button>
          </li>
          <li className="nav-item">
            <button
              className={`nav-link ${activeTab === "progress" ? "active" : ""}`}
              onClick={() => setActiveTab("progress")}
            >
              üìà Progresso
            </button>
          </li>
        </ul>

        {/* Conte√∫do de cada aba */}
        <div>
          {activeTab === "info" && (
            <div>
              <p><strong>Email:</strong> {student.email}</p>
              <p><strong>Telefone:</strong> {student.phone || "N√£o informado"}</p>
              <p><strong>Idade:</strong> {student.age || "N√£o informada"}</p>
              <p><strong>Peso:</strong> {student.weight ? `${student.weight} kg` : "N√£o informado"}</p>
              <p><strong>Altura:</strong> {student.height ? `${student.height} m` : "N√£o informada"}</p>
              <p><strong>Objetivo:</strong> {student.goal || "N√£o informado"}</p>
            </div>
          )}

          {activeTab === "workouts" && (
            <div>
              <h5>üèãÔ∏è Treinos</h5>
              <p className="text-muted">
                Aqui aparecer√£o os treinos cadastrados para o aluno.
              </p>
            </div>
          )}

          {activeTab === "feedbacks" && (
            <div>
              <h5>üí¨ Feedbacks</h5>
              <p className="text-muted">
                Em breve: coment√°rios e notas dos treinos.
              </p>
            </div>
          )}

          {activeTab === "progress" && (
            <div>
              <h5>üìà Progresso f√≠sico</h5>
              <p className="text-muted">
                Hist√≥rico de evolu√ß√£o do aluno (peso, medidas, etc).
              </p>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default StudentDetailsPage;
